.examination {
  width: 100%;
  background: #eee;
}

.head {
  height: 80px;
  padding: 25px;
  box-sizing: border-box;
  font-size: 26px;
}

.bigBox {
  width: 96%;
  background: #fff;
  margin: 0 auto;
  border-radius: 15px;
  .add {
    padding: 20px;
  }
  .style_exam {
    min-height: 980px;
    margin: auto;
    padding: 80px;
    padding-top: 40px;
    text-align: center;
    position: relative;
    h2 {
      margin-top: 0;
      margin-bottom: 0.5em;
      color: rgba(0, 0, 0, 0.85);
      font-weight: 500;
    }
    .top {
      display: block;
      margin-block-start: 1em;
      margin-block-end: 1em;
      margin-inline-start: 0px;
      margin-inline-end: 0px;
    }
    .style_questionitem {
      border: solid 1px #ccc;
      padding: 0 20px;
      .style_questionitem__3ETlC {
        h4 {
          margin-block-start: 1.33em;
          margin-block-end: 1.33em;
          margin-inline-start: 0px;
          margin-inline-end: 0px;
          display: flex;
          justify-content: space-between;
          a {
            color: #1890ff;
            background-color: initial;
            text-decoration: none;
            outline: none;
            cursor: pointer;
            transition: color 0.3s;
          }
        }
      }
    }
    button {
        margin-top: 20px;
        padding: 10px 40px!important;
        border-radius: 4px!important;
        border: 0!important;
        font-size: 14px!important;
        color: #fff!important;
        background: linear-gradient(-90deg,#4e75ff,#0139fd)!important;
        span{
            pointer-events: none;
            display: inline-block;
        }
    }
  }
}
